import {useState, useEffect} from 'react';
import {Redirect} from 'react-router-dom';
import {Presentational as BrowseUsers} from './presentational'
import { Request_Api } from '../customHooks/requestAPI'

export const Container=()=>{
    const [users, setUsers]=useState([]);
    const [addUser, setAddUser]=useState(false);
    // const { data } = Request_Api("http://localhost:3000/user/getAll", {method:"GET"});
    // setUsers(data.data);
    useEffect(()=>{
        const execFetch=async()=>{
            const response = await fetch("http://localhost:3000/user/getAll", {method:"GET"});
            const json = await response.json();
            console.log("jsonsss",json);
            setUsers(json.data);
        };
        
        execFetch();
    }, []);
    
    const clickAddUser=()=>{
        setAddUser(true);
    };
    if (addUser) {
        return <Redirect to="/usuario" push={true} />;

    }
    return(
        <BrowseUsers rows={users} setRows={setUsers} clickAddUser={clickAddUser} />
    )
};
